async () => {


			if(selectFilesProofOfIdentity.files.length === 1) {
					await JSObjectUploadKYC.deleteIfFileExist('POI');				
					await	QueryInsertEntityKYCFGN.run({ 
						docType: vayProofofidentity.text, 
						docPathFilename: selectFilesProofOfIdentity.files[0].name
					});
					QueryPOI.run();
			}

			if(selectFilesProofOfAddress.files.length === 1) {
				await JSObjectUploadKYC.deleteIfFileExist('POA');		
				await	QueryInsertEntityKYCFGN.run({
					docType:vayProofofaddress.text,
					docPathFilename: selectFilesProofOfAddress.files[0].name
				});
				await QueryProofAddress.run();
			}

		if(selectFilesTaxRegCert.files.length === 1) {
			await JSObjectUploadKYC.deleteIfFileExist('TRC');
			await QueryInsertEntityKYCFGN.run({
				docType:'Tax Registration Certificate',
				docPathFilename :selectFilesTaxRegCert.files[0].name
			});
			await QueryTaxRegCert.run();
		}

		if(selectFilesCancelledCheque.files.length === 1) {
			await JSObjectUploadKYC.deleteIfFileExist('CC');
			await QueryInsertEntityKYCFGN.run({ 
				docType:'Cancelled Cheque',
				docPathFilename :selectFilesCancelledCheque.files[0].name
			});
			await QueryCancelledCheque.run();
		}

		showAlert('KYC Documents Uploaded');
		navigateTo('Individual KYC Summary', {});
	}

